青柳翔・玉城ティナ・千葉雄大・永山瑛太・前田敦子が短編映画監督に初挑戦
WOWOWが開局30周年を記念して行ったプロジェクト『アクターズ・ショート・フィルム』の第2弾で監督に挑戦する俳優が発表された。青柳翔、玉城ティナ、千葉雄大、永山瑛太、前田敦子の5人。既に俳優として実績を持つこの5人が、今回は監督としてどんな才能を開花させるのか。　このプロジェクトは、予算・撮影日数など同条件で5人の俳優たちが25分以内のショートフィルムを制作。世界から6000本超のショー...
